<!DOCTYPE HTML>
<html>
<head>
<meta http-equiv="Content-Type" content="text/html; charset=utf-8">
<script type="text/javascript">
var root = this;
this.___prev_module = this.module;
this.module = {};
</script>
<script type="text/javascript" src=".cache.options.json"></script>
<script type="text/javascript">
this.___opts = this.module.exports;
if(this.___prev_module == null) {
	this.module = null;
	try {
		delete this.module;
	} catch (e) {
	}
} else {
	this.module = this.___prev_module;
	try {
		delete this.___prev_module;
	} catch (e) {
	}
}
</script>
<script type="text/javascript">
document.write("<title>" + this.___opts.name + " Benchmarking Tests</title>");
</script>
<link rel="stylesheet" media="screen" href="perf/perf.css" />
</head>

<body>
<script type="text/javascript">
document.write("<h1 id=\"perf-header\">" + this.___opts.name + " Benchmarking Tests</h1>");
</script>

<table id="perf-container">
	<thead>
		<tr class="perf-header">
			<th colspan="3" id="perf-status">Initializing...</th>
		</tr>
		<tr class="perf-sub-header">
			<th>Name</th>
			<th>Ops/sec</th>
			<th>Test</th>
		</tr>
	</thead>
	<tbody id="perf-tests"></tbody>
</table>

<script type="text/javascript">
var root = this;
</script>
<script type="text/javascript">
(function(files) {
	for ( var i = 0, l = files.length; i < l; i++) {
		document.write("\n" + '<scr' + 'ipt type="text/javascript" src="../vendor/' + files[i] + '"></scr' + 'ipt>');
	}
})(this.___opts.external || []);
</script>
<script type="text/javascript">
(function(files) {
	for ( var i = 0, l = files.length; i < l; i++) {
		document.write("\n" + '<scr' + 'ipt type="text/javascript" src="../src/' + files[i] + '"></scr' + 'ipt>');
	}
})(this.___opts.src);
</script>
<script type="text/javascript" src="perf/benchmark.js"></script>
<script type="text/javascript">
var ___benchmarks = new Benchmark.Suite();
</script>
<script type="text/javascript" src="perf/perf.js"></script>
<script type="text/javascript">
(function(files) {
	for ( var i = 0, l = files.length; i < l; i++) {
		document.write("\n" + '<scr' + 'ipt type="text/javascript" src="../perf/' + files[i] + '"></scr' + 'ipt>');
	}
})(this.___opts.perf);
</script>
<script type="text/javascript">
___benchmarks.run({
	async : true,
	queued: true
});
</script>
</body>
</html>
